import React from 'react'
import { Provider } from 'react-redux';
import { store } from '../redux/store';
import Navbar from './navbar'

describe('<Navbar />', () => {
  it('renders', () => {
    // see: https://on.cypress.io/mounting-react
    cy.mount(
      <Provider store={store}>
        <Navbar />
      </Provider>
    )
  })
})
